export const styles = theme => ({
    root: {
        background: theme.palette.white.main,
        display: "flex",
        justifyContent: "center",
    },
    fullWidth: {
        borderRadius: "16px",
        overflow: "hidden",
        width: "100%",
    },
    notSlider: { "& + &": { marginLeft: theme.spacing(2) } },
    item: {
        display: "flex !important",
        justifyContent: "center",
    },
});
